import React from "react";
import "./signin.css";
//import workoutImage from "./image1.png"; // Ensure this path is correct

const SignIn = () => {
  return (
    <div className="flex flex-col md:flex-row h-screen bg-gradient-to-r from-blue-900 to-orange-500">
      <div className="hidden md:block w-1/2 relative">
        <img src="https://placehold.co/400x400" alt="Workout Image" className="absolute inset-0 w-full h-full object-cover rounded-l-lg" />
      </div>
      <div className="flex flex-col justify-center items-start w-full md:w-1/2 p-8 bg-white rounded-lg shadow-lg"> {/* Changed items-center to items-start */}
        <h1 className="text-2xl font-bold mb-6">SIGN IN</h1>
        <input type="email" placeholder="Email" className="border border-zinc-300 p-2 rounded mb-4 w-full" />
        <input type="password" placeholder="Password" className="border border-zinc-300 p-2 rounded mb-4 w-full" />
        <button className="bg-orange-500 text-white p-2 rounded w-full hover:bg-orange-400">SIGN IN</button>
        <div className="my-4 text-center">
          <span className="text-zinc-500">or</span>
          <button className="flex items-center justify-center border border-zinc-300 p-2 rounded mt-2 w-full">
            <img src="https://openui.fly.dev/openui/20x20.svg?text=G" alt="Google Logo" className="mr-2" />
            Sign in with Google
          </button>
        </div>
        <div className="text-sm text-zinc-500">
          <a href="#" className="hover:underline">Create an account?</a> |
          <a href="#" className="hover:underline">Forgot password?</a>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
